class EyeCatalog {

    private static _instance: EyeCatalog;

    public static get instance() {
        if (EyeCatalog._instance == null) {
            EyeCatalog._instance = new EyeCatalog();
        }
        return EyeCatalog._instance;
    }

    getEyes(token: Token) {
        let result = this.getEyeAndBrow(token.eyeType, token.species);
        return result.replace(/#754324/g, token.eyeColor);
    }

    private getEyeAndBrow(eyeType: EyeType, species: Species) {
        let result = Eye1;
        if (eyeType === EyeType.Eye2) {
            result = (species === Species.Vulcan ? Eye2VulcanBrows : Eye2StandardBrows) + Eye2;
        } else if (eyeType === EyeType.Eye3) {
            result = (species === Species.Vulcan ? Eye3VulcanBrows : Eye3StandardBrows) + Eye3;
        } else if (eyeType === EyeType.Eye4) {
            result = (species === Species.Vulcan ? Eye4VulcanBrows : Eye4StandardBrows) + Eye4;
        } else if (eyeType === EyeType.Eye5) {
            result = (species === Species.Vulcan ? Eye5VulcanBrows : Eye5StandardBrows) + Eye5;
        } else if (eyeType === EyeType.Eye6) {
            result = (species === Species.Vulcan ? Eye6VulcanBrows : Eye6StandardBrows) + Eye6;
        } else if (eyeType === EyeType.Eye7) {
            result = (species === Species.Vulcan ? Eye7VulcanBrows : Eye7StandardBrows) + Eye7;
        }
        return result;
    }

    getSwatches(token: Token) {
        if (token.species === Species.Vulcan) {
            return [
                new Swatch(EyeType.Eye1, "Average Eyes", (token) => EyeCatalog.decorateSwatch(this.getEyeAndBrow(EyeType.Eye1, token.species), token)),
                new Swatch(EyeType.Eye2, "Heavier Brow", (token) => EyeCatalog.decorateSwatch(this.getEyeAndBrow(EyeType.Eye2, token.species), token)),
                new Swatch(EyeType.Eye3, "Thin Brow, Narrower Eyes", (token) => EyeCatalog.decorateSwatch(this.getEyeAndBrow(EyeType.Eye3, token.species), token)),
                new Swatch(EyeType.Eye4, "Thin Brow, Wider Eyes", (token) => EyeCatalog.decorateSwatch(this.getEyeAndBrow(EyeType.Eye4, token.species), token)),
                new Swatch(EyeType.Eye5, "Heavy Brow", (token) => EyeCatalog.decorateSwatch(this.getEyeAndBrow(EyeType.Eye5, token.species), token)),
                new Swatch(EyeType.Eye6, "Older", (token) => EyeCatalog.decorateSwatch(this.getEyeAndBrow(EyeType.Eye6, token.species), token)),
                new Swatch(EyeType.Eye7, "Feminine", (token) => EyeCatalog.decorateSwatch(this.getEyeAndBrow(EyeType.Eye7, token.species), token)),
            ];
        } else {
            return [
                new Swatch(EyeType.Eye1, "Vulcan-esque Angled Brows", (token) => EyeCatalog.decorateSwatch(this.getEyeAndBrow(EyeType.Eye1, token.species), token)),
                new Swatch(EyeType.Eye2, "Standard Brow", (token) => EyeCatalog.decorateSwatch(this.getEyeAndBrow(EyeType.Eye2, token.species), token)),
                new Swatch(EyeType.Eye3, "Thin Brow, Narrower Eyes", (token) => EyeCatalog.decorateSwatch(this.getEyeAndBrow(EyeType.Eye3, token.species), token)),
                new Swatch(EyeType.Eye4, "Thin Brow, Wider Eyes", (token) => EyeCatalog.decorateSwatch(this.getEyeAndBrow(EyeType.Eye4, token.species), token)),
                new Swatch(EyeType.Eye5, "Heavy Brow", (token) => EyeCatalog.decorateSwatch(this.getEyeAndBrow(EyeType.Eye5, token.species), token)),
                new Swatch(EyeType.Eye6, "Older", (token) => EyeCatalog.decorateSwatch(this.getEyeAndBrow(EyeType.Eye6, token.species), token)),
                new Swatch(EyeType.Eye7, "Feminine", (token) => EyeCatalog.decorateSwatch(this.getEyeAndBrow(EyeType.Eye7, token.species), token)),
            ];
        }
    }

    private static decorateSwatch(svg: string, token: Token) {
        let result = `<svg viewBox="0 0 110 110" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                <g transform="translate(-250, -75)">`
                + svg.replace(/#754324/g, token.eyeColor)
            + `</g>
            </svg>`;
        return result;
    }
}

export default EyeCatalog;